import React, { useState } from "react";

const FilterTask = (props) => {
  const [filter, setFilter] = useState({
    pending: false,
    inProgress: false,
    done: false
  });

  return (
    <div>
      <p className="txt">Filter Tasks</p>
      <div className="box">
        <input
          type="checkbox"
          id="pending"
          name="pending"
          value={filter.pending}
          onChange={() => setFilter({...filter, pending: !filter.pending})}
          defaultChecked
        />
        <label htmlFor="pending">Pending</label>
        <input
          type="checkbox"
          id="inProgress"
          name="inProgress"
          value={filter.inProgress}
          onChange={() => setFilter({...filter, inProgress: !filter.inProgress})}
          defaultChecked
        />
        <label htmlFor="inProgress">In Progress</label>
        <input
          type="checkbox"
          id="done"
          name="done"
          value={filter.done}
          onChange={() => setFilter({...filter, done: !filter.done})}
          defaultChecked
        />
        <label htmlFor="done">Done</label>
      </div>
    </div>
  );
};

export default FilterTask;
